About Game:
************
Jane, the new police recruit, is about to take part in an exciting detective story. Help solve this dangerous case in modern New York as a member of the Dog Unit. Detective Kane and his dog, &quot;Detective&quot; Max will be your partners. 
Complete interactive hidden object scenes and solve challenging minigames to solve the case. Max is always there to help you out even in the most difficult situations.

Game Features:
**************
* Dozens of interactive hidden object scenes
* Photorealistic graphics
* An adorable 3D animated dog
* High quality sound and music

